const initialStore = {
    link : "",
    threats : []
}

const summaryReducer = (state = initialStore,action) => {
    
    if(action.type === "summary"){
        var linkbase = "https://295-videos.s3.us-east-2.amazonaws.com/images/icon";
        switch(action.payload)
        {
            case 1 : linkbase = linkbase + "-1.png"; break;
            case 2 : linkbase = linkbase + "-6.png"; break;
            case 3 : linkbase = linkbase + "-3.png"; break;
            case 4 : linkbase = linkbase + "-4.png"; break;
            case 5 : linkbase = linkbase + "-5.png"; break;
            case 6 : linkbase = linkbase + "-6.png"; break;
            case 7 : linkbase = linkbase + "-7.png"; break;
            case 8 : linkbase = linkbase + "-1.png"; break;

        }
        return {
            ...state,
            link : linkbase,
        }

    } 
    return state;
}

const threatsReducer = (state = initialStore,action) => {
    
    if(action.type === "threats"){
        return {
            ...state,
            threats : action.payload.threats,
        }
    } 
    return state;
}

export default summaryReducer;
